import React, { Component } from 'react'

class Form extends Component {
  render() {
    return (
      <div>
        <form>
          <div>
            <label>Username</label>
            <input type="text" />
          </div>
          {/* <button type="submit">Submit</button> */}
        </form>
      </div>
    )
  }
}

export default Form
